import Image from "react-bootstrap/Image"

const Home = () => {
    return (
        <div className="homePage">
            <Image src="bo600.png" roundedCircle="true"/>
            <div className="bio">
                <h1>About Me</h1>
            </div>
        </div>
    );
};

export default Home;
